import React from 'react';
import Header from '../Header';
function Feminino({ modelo }){
    return(
        <div>
            <ul>
                {modelo.filter((item)=>item === 'Feminino')
                    .map((item,index)=>(
                        <li key={index}>
                            <h1>{item.nome}</h1>
                        </li>
                    ))}
            </ul>

        </div>
    );
};

export default Feminino;
